import "./mainPage.css";
import { motion } from "framer-motion";

function mainPage() {
  return (
    <div className="App">
      <header className="App-header">
        <motion.img
          drag
          dragConstraints={{
            top: -50,
            left: -50,
            right: -50,
            bottom: -50,
          }}
          alt="sunset logo"
          src="favicon.ico"
          width={"100px"}
        />
      </header>
    </div>
  );
}

export default mainPage;
